Recuerdo el momento en el que me enteré que Gus había partido. En 2014 yo estaba en mi primer año de facultad y a partir de ese momento too el día fue vacío.
A lo largo de mi vida he tenido muchas bandas y artistas favoritos, pero nunca nadie ha logrado ocupar el lugar que Gustavo Cerati tiene en mi corazón. Sus canciones han sido de los mejores regalos que he recibido del universo.
Siempre lamentaré el no haber podido estar presente en algún concierto. Es una espinita que jamás lograré quitarme. Sin embargo sé que seguiré amando su ser y su esencia, no importa que ya no esté.
Abrazo eterno Gus, una vez más, gracias totales.

